import Input from './Input';
import Radio from './Radio';

const Form = (props) => {
  return (
    <form>
      <Input
        label="Indique el nombre "
        id="name"
        value={props.name}
        handleInput={props.handleInput}
      />
      <Input
        label="Indique el descripcion "
        id="description"
        value={props.desc}
        handleInput={props.handleInput}
      />
      <Input label="Indique la url de la img " id="img" />
      <Radio label="Francia " id="country1" name="country" value="francia" />
      <Radio label="España " id="country2" name="country" value="españa" />
    </form>
  );
};
export default Form;
